import React from "react";
import { Container } from "react-bootstrap";

const Contact = () => {
  return (
    <>
      <div>
        <Container>
          <figure className="position-relative">
            <img
              src="../images/footer.png"
              alt="footer"
              className="img-fluid"
            />
          </figure>
        </Container>
      </div>
    </>
  );
};
export default Contact;
